  false,\n\t\"url\": null,\n\t\"notes\": \"Phytoplankton and other data were collected
  from net and bottle casts in the North Pacific Ocean from NOAA Ship SURVEYOR from
  15 March 1976 to 26 April 1976. Data were collected by the University of Alaska;
  Institute of Marine Science (UAK/IMS) as part of Outer Continental Shelf Environmental
  Assessment Program (OCSEAP). Data were processed by NODC to the NODC F028 Phytoplankton
  format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f028.html.
  An analog file for this accession is available from NODC user services.nnThe F028
  format is used for data from the sampling and analysis of marine phytoplankton.
  Information on phytoplankton abundance, distribution, and productivity derived from
  these data support studies of marine populations and ecosystems. Data reported may
  include: position, date, and time of sampling; bottom depth and sampling depths;
  volume of water filtered; and concentration of cells, carbon concentration, wet
  and dry weight, and counts for each species reported. Comments may be relayed in
  a text record.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
